import React from "react";
import {Link} from 'react-router-dom'; 
const DetailDisplay = (props)=>{

    const renderProduct = (detail)=>{
        if(detail){
            if(detail.length>0){
                return(
                    detail.map((item)=>{
                        return(
                            <div class="filter-container">
                                <div class="card" key={item._id}> 
                                    <Link to={`/placeOrder`}>                     
                                    <div class="imageDiv">
                                        <img src={item.product_img} alt={item.product_name}/>
                                    </div>
                                    </Link>                    
                                </div>                    
                            </div>
                        )
                    })
                )
            }
        }

    }

    return(  
        <div class="main-div">     
                {renderProduct(props)}     
        </div>
    )





